import './App.css';
import styled from '@emotion/styled';
import React from 'react';
import Collapsible from 'react-collapsible';
import Accordion from './components/'

import EquipmentManager from './components/EquipmentSorting/EquipmentManager'
import WeatherForecast from './components/Weather/WeatherForecast';
import GaugeHolder from './components/Gauges/GaugeHolder';



const App = () => {
  return (
    <div className="App">
      <h1>Equipment Page</h1>
      <div className= "weatherContainer">
        <WeatherForecast  />
      </div>
      <div className = "gaugeContainer">
      <GaugeHolder id="gauge-chart1" width="40%"/>
      </div>
      <Collapsible trigger="Recommended Equipment (click to open)" is-open={true}>
      <EquipmentManager/>
      </Collapsible>
      <Collapsible trigger="Optional Equipment (click to open)">
      <EquipmentManager />
      </Collapsible>
      <Collapsible trigger="Unecessary Equipment (click to open)">
      <EquipmentManager />
      </Collapsible>
    </div>
  );
}



export default App;
